Témbok Gedé Cina Témbok Gedé Cina (Citakan:Zh-tspl) nyaéta témbok pertahanan Cina nu diwangun ti mimiti abad ka-3 SM nepi ka awal abad ka-17, dina raraga nyalametkeun sababaraha dinasti Cina tina serangan urang Hun, Mongol, Turki, jeung suku pengembara nu datang di wewengkon Mongolia jeung Manchuria ayeuna. Sababaraha bagean diwangun saprak abad katilu SM, nu kawentar ngeunaan Tembok Besar Cina ieu diwangun antara 220 BC nepi 200 BC ku Kaisar Cina munggaran, Qin Shi Huangdi (tempatna leuwih ka k
..........
] Tembok dilengkepan ku stasion pertahananan, nu mana tembok pertahanan ieu bisa dipake benteng keur mundur. Unggal menara unik jeung sarta tangga asupna matak ngabingungkeun nu nyerang. Pusat barak jeung administrasi aya dina interval nu leuwih gede. Material[édit | sunting sumber] Material nu dipake nyaeta material nu aya deukeut kana tembok. Tembok deukeut Beijing diwangun tina blok tambang batu kapur. Di tempat sejen bisa oge tina granite atawa batubata. Sababaraha material dipake, tungtung
